var tipuesearch = {"pages":[{"title":"About","text":"2018 Fall 分組網誌 課程倉儲: https://github.com/mdecourse/2018fall 課程投影片: https://mdecourse.github.io/2018fall/reveal 課程網誌: https://mdecourse.github.io/2018fall/blog","tags":"misc","url":"https://mdecadp2018.github.io/site-40623129/blog/pages/about/"},{"title":"第七週心得","text":"心得: 修改網路設定 網路修改: 到設定-->網路和網際網路-->乙太網路2-->IPv4輸入140.130.7.3(或2)更改DNS","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623129/blog/40623129-blog-w7.html"},{"title":"第六週心得","text":"心得: 今天使用個人網站時遇到問題，git的更新會讓git push失敗,要在cmd中輸入git config --global http.sslverify \"flase\"就可以上推,但把.git丟回下載的p37也可以成功上推。","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623129/blog/40623129-blog-w6.html"},{"title":"第四週心得","text":"心得: 英文在未來非常重要所以要大量的去學習英文單字使用 全英字典 可以查詢單字，使用onshap後發現跟繪圖軟體solidworks差不多，只要有網路無論在哪裡都可以使用不需要去下載，而且每次畫圖它都會自動存檔不怕當機或是沒段網路，非常方便。","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623129/blog/40623129-blog-w4.html"},{"title":"第三週心得","text":"心得: 了解為何使用git，在修改及創造新的議題時利用github push至遠端，修改完在推上去遠端，別人在clone下來時，就不會有版本問題了 模擬可以提升抽象性，因此數學很重要","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623129/blog/40623129-blog-w3.html"},{"title":"第二週心得","text":"心得: 切換分支有兩個方法，第一種是直接到網站耿改成分支gh-pages並pull，第二種使用小黑窗用git checkout gh-pages再用git branch然後在上推。","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623129/blog/40623129-blog-w2.html"},{"title":"第一週心得","text":"心得: 這學期跟上學期一樣要新建倉儲然後上推，並到github領取個人作業然後要學習如何使用oneshap完成功課。","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623129/blog/40623129-blog-w1.html"},{"title":"2018 Fall 分組網誌","text":"2018 Fall 開始將網際內容管理、投影片與網誌進行整合. 課程倉儲 利用 Github 倉儲存放與計算機程式相關的資料, 有幾項好處: 第一, 在不自建網站的情況下, 目前 Github 仍允許免費使用, 管理者除了可以利用網際模式將資料送到對應的 cp github 倉儲 外, 也可以利用近端的 git 客戶端程式, 以分散式版次的流程管理各階段的改版資料. 第二, Github 提供的 Github Pages, 可以讓純 html 加上 Javascript 的網站, 直接在 cp 課程網站 伺服. 第三, 改版後的 CMSimfly, 加上 Pelican 靜態網誌與 Reveal.js 投影片系統, 均為靜態網站資料, 可以直接整合一起, 透過一個網址當作上課參考資料. 該學習哪種程式語言? C/C++、Python、Lua 或 Javascript? 都可以. 在這裡, 學 C/C++ 是為了編寫 Arduino 控制程式, 以及結合 Qt5 建立各種能快速進行工程分析的程式庫, 學習 Python 是為了快速完成 C/C++ 無法迅速完成的分析、模擬與運算, 也能透過 PyQt5 建立視窗程式, 或者呼叫 Flask 建立能在網際環境中執行的協同設計套件. 學習 Lua 是為了能在 V-rep 中使用, 至於 Javascript, 已經無所不在, 尤其在網際成是開發過程, 更是重要, 有其學習的必要性.","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623129/blog/2018-Fall-Project-Blog.html"}]};